--
-- Name: changelogs; Type: TABLE; Schema: public; Owner: root
--

CREATE TABLE public.changelogs (
    issue_key text,
    author_key text,
    from_status text,
    to_status text,
    created_at timestamp without time zone
);

--
-- Name: issues; Type: TABLE; Schema: public; Owner: root
--

CREATE TABLE public.issues (
    issue_key text,
    project_key text,
    issue_type text,
    assignee_key text,
    created_at timestamp without time zone
);

